import React, { useMemo } from 'react';
import './Projects.css';

const Projects = ({ theme }) => {
  const sectionStyles = useMemo(() => ({
    '--projects-bg': theme === 'dark' ? 'linear-gradient(135deg, #042a1c 0%, #042a1c 100%)' : 'linear-gradient(135deg, #EEEEEE 0%, #EEEEEE 100%)',
    '--projects-title-color': theme === 'dark' ? '#e3e5e6' : '#000000',
    '--text-shadow-1': theme === 'dark' ? '#0d4f3c' : '#374151',
    '--text-shadow-2': theme === 'dark' ? '#1a5f4a' : '#4b5563',
    '--text-shadow-3': theme === 'dark' ? '#2d6b58' : '#6b7280',
    '--text-shadow-4': theme === 'dark' ? '#407766' : '#9ca3af'
  }), [theme]);

  return (
    <section 
      id="projects" 
      className="projects-section"
      style={sectionStyles}
    >
      <div className="projects-container">
        <div className="projects-content">
          <div className="projects-header">
            <h2 className="projects-title text-shadows">
              Projects
            </h2>
          </div>
        </div>
      </div>
    </section>
  );
};

export default Projects;
